import React from 'react';

import TableRow from './TableRow';
const TableBody = (props,) => {
  const bookings = props.results
  return(
    <tbody>
      {bookings.map((data) => (
           <TableRow info={data}/>  
          ))
        } 
    </tbody>
  )
}
export default TableBody;
